import Model from "../models/Model.js"
function List (props) {
    const list = props.props;
    console.log(list);
    return(
        <div className="List">
            {list.map((data)=>(
                <div className="col-lg-4" key={data._id}>
                  
                </div>              
            ))}
        </div>
    );
}
export default List;
